import './forms.css';

const Forms = () => {
    return (
        <div className="forms">
            <div className="container forms-container">
                <h1>Forms</h1>
                {/* <div className="form-company"> */}
                    <form action="#">
                        <div className="form-fields">
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="text" />
                            <input type="button" value="Submit" className='btn'/>
                        </div>
                    </form>
                {/* </div> */}
            </div>
        </div>
    );
}

export default Forms;
